TITLE:
  - 'simple, academic test case for monolithic scalar-structure interaction:'
  - '- three-dimensional problem involving standard scalar transport'
  - '- cubic domain discretized by 3 blocks of hex8 elements (anode,electrolyte,cathode)'
  - '- material properties representing NCM-111, LiPON and Li-Metal (only elastic)'
  - '- battery is first compressed in axial direction'
  - '- then the battery is charged using a neumann bc on cathode side current collector'
  - '- homogeneous neumann boundary conditions are applied to all other surfaces'
  - '- potential is set zero by a dirichlet condition at the anode side current collector'
  - '- mesh tying formulation between left and middle block with conforming mesh'
  - '- nitsche contact formulation between middle and right block with non-conforming mesh'
PROBLEM TYPE:
  PROBLEMTYPE: "Structure_Scalar_Interaction"
IO:
  STDOUTEVERY: 0
